static uint16_t* current_note = note_A;

uint16_t* get_note_A(void){
	return note_A;
}

uint16_t* get_note_B(void){
	return note_B;
}

uint16_t* get_note_C(void){
	return note_C;
}

uint16_t* get_note_D(void){
	return note_D;
}

uint16_t* get_note_E(void){
	return note_E;
}

uint16_t* get_note_F(void){
	return note_F;
}

uint16_t* get_note_G(void){
	return note_G;
}

uint16_t* get_note_silence(void){
	return note_silence;
}


void set_current_note(uint16_t* note){
	current_note = note;
}

uint16_t* get_current_note(void){
	return current_note;
}

uint16_t* get_next_note(void){
	if(get_current_note() == get_note_A()){
		set_current_note(get_note_B());
		return get_note_B();
	}
	else if(get_current_note() == get_note_B()){
		set_current_note(get_note_C());
		return get_note_C();
	}
	else if(get_current_note() == get_note_C()){
		set_current_note(get_note_D());
		return get_note_D();
	}
	else if(get_current_note() == get_note_D()){
		set_current_note(get_note_E());
		return get_note_E();
	}
	else if(get_current_note() == get_note_E()){
		set_current_note(get_note_F());
		return get_note_F();
	}
	else{
		set_current_note(get_note_A());
		return get_note_A();
	}
}

uint16_t* get_next_partiture_note(void){
	static uint8_t current_partiture = 0;
	static uint16_t* next_note;
	uint16_t* full_song[48] = {get_note_C(), get_note_C(), get_note_G(), get_note_G(),
							get_note_A(), get_note_A(), get_note_G(), get_note_silence(),
							get_note_F(), get_note_F(), get_note_E(), get_note_E(),
							get_note_D(), get_note_D(), get_note_C(), get_note_silence(),
							get_note_G(), get_note_G(), get_note_F(), get_note_F(),
							get_note_E(), get_note_E(), get_note_D(), get_note_silence(),
							get_note_G(), get_note_G(), get_note_F(), get_note_F(),
							get_note_E(), get_note_E(), get_note_D(), get_note_silence(),
							get_note_C(), get_note_C(), get_note_G(), get_note_G(),
							get_note_A(), get_note_A(), get_note_G(), get_note_silence(),
							get_note_F(), get_note_F(), get_note_E(), get_note_E(),
							get_note_D(), get_note_D(), get_note_C(), get_note_silence()
						};

	next_note = full_song[current_partiture];
	if(47 == current_partiture){
		current_partiture = 0;
	}
	else{
		current_partiture++;
	}

	return next_note;
}

void set_sound_index(uint32_t value){
	sound_index = value;
}

uint32_t get_sound_index(void){
	return sound_index;
}

bool_t end_flag = FALSE;

void set_end_flag(bool_t value){
	end_flag = value;
}

bool_t get_end_flag(void){
	return end_flag;
}

void sound_note(uint32_t pit){

	if(get_sound_index() < 8000){
		DAC_setValue(get_current_note()[get_sound_index()]);
	}
	else{
		PIT_stop();
		set_end_flag(TRUE);
	}

	set_sound_index(get_sound_index() + 1);
}
